import LessonBody from './LessonComponent/LessonBody';
import Frame from 'react-frame-component';

class Body extends Component {
  render() {
    return (
      <div>
        <Frame>
    <h1><LessonBody /></h1>
  </Frame>
  <Frame>
    <h1><LessonBody /></h1>
  </Frame>
      </div>
    )
  }
}
export default Body;
